import React from 'react';
import Jayalogo from "../assets/logo3.png"

const Header = () => {
  return (
    <header className="sticky top-0 bg-white shadow-md  z-50">
     
      <nav className="flex bg-blue-800 justify-between items-center px-14 py-2">
       <img src={Jayalogo} alt="" className=" h-12" />
        <ul className="flex space-x-4 items-center text-white font-sans text-sm   ">
          <button className='border border-white px-4 py-1 outline-none'>প্রবেশ করুন</button>
          <button className='bg-orange-600 p-4 h-9'>নিবন্ধন</button>
          <span className='font-semibold'><span className='text-lg'>৳</span> BDT Bengali</span>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
